import {useState, useEffect} from 'react';
import "./ShoeDetail.css"
import { useParams } from 'react-router-dom';


function ShoeDetail() {
    const [shoe, setShoe] = useState({});
    const { id } = useParams();

    async function loadShoe() {
        const response = await fetch(`http://localhost:8080/api/shoe/${id}/`);
        const data = await response.json();
        setShoe(data);
    }
    useEffect(() => {
        loadShoe();
    }, []);

    const randomNumber = Math.floor(Math.random() * 9) + 1;


    const ShoeTabs = (props) => {
        const [activeTab, setActiveTab] = useState('details');

    }


    const handleTabClick = (tabName) => {
        setActiveTab(tabName);
    };

return (
    <div>
    <div className='product'>
        <div className='boxesDiv'>
            <div className='col-10 card'>
                <div className="imgContainer">
                    <div className='image1Div'>
                    <img className="image1" src={`/images/img${randomNumber}.png`}/>
                    </div>
                </div>
                <div className='description'>
                    <p> {shoe.description}</p>
                </div>
            </div>
            <div className='card2'>
                <div className='shoeInfo'>
                    <div className='nameDiv'>
                    <h5 className='name'>{shoe.name}</h5>
                    </div>
                <hr></hr>
                <div>
                    <div>
                        <h5>Brand</h5>
                        <p className='tableData'>{shoe.brand}</p>
                        <hr></hr>
                    </div>
                    <div>
                        <h5>Category</h5>
                        <p className='tableData'>{shoe.category}</p>
                        <hr></hr>
                    </div>
                    <div>
                        <h5>Price</h5>
                        <p className='tableData'>{shoe.price}</p>
                        <hr></hr>
                    </div>
                    <div>
                        <h5>Size</h5>
                        <p className='tableData'>{shoe.size}</p>
                        <hr></hr>
                    </div>
                    <div>
                        <h5>Color</h5>
                        <p className='tableData'>{shoe.color}</p>
                        <hr></hr>
                    </div>
                    <div>
                        <h5>Sku</h5>
                        <p className='tableData'>{shoe.sku}</p>
                        <hr></hr>
                    </div>
                    <div>
                        <h5>Gender</h5>
                        <p className='tableData'>{shoe.gender}</p>
                        <hr></hr>
                    </div>
                </div>
                </div>
            </div>
        </div>
    </div>
    <div className="tab-section">
        <ul className="tab-list">
            <li className={`tab-item ${activeTab === 'details' ? 'active' : ''}`} onClick={() => handleTabClick('details')}>Details</li>
            <li className={`tab-item ${activeTab === 'size-fit' ? 'active' : ''}`} onClick={() => handleTabClick('size-fit')}>Size & Fit</li>
            <li className={`tab-item ${activeTab === 'reviews' ? 'active' : ''}`} onClick={() => handleTabClick('reviews')}>Reviews</li>
            <li className={`tab-item ${activeTab === 'qa' ? 'active' : ''}`} onClick={() => handleTabClick('qa')}>Q&A</li>
        </ul>
        <div className="tab-content">
            {activeTab === 'details' && <p>{shoe.description}</p>}
            {activeTab === 'size-fit' && <p>{props.shoe.size}</p>}
            {activeTab === 'reviews' && <p>{props.shoe.review}</p>}
            {activeTab === 'qa' && <p>{props.shoe['q&a']}</p>}
        </div>
    </div>
    </div>
);
}
export default ShoeDetail;
